import Daily from "./Daily/Daily";
import Weekly from "./Weekly/Weekly";
import FormContext from "../../../store/formShown/form--context";

import style from "./Home.module.css";

function Home() {
  return (
    <FormContext.Provider>
      <div className={style.home}>
        <Daily />
        <Weekly />
      </div>
    </FormContext.Provider>
  );
}

export default Home;
